import "./App.css";
import axios from "axios";
import { useState, useEffect } from "react";

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    const getData = async () => {
      try {
        const res = axios.post(
          'http:localhost:3000/api',
          {
            headers: { "Content-Type": "text/plain" },
          },
          {
            foo: "bar",
          }
        );
        console.log(res);
        setMessage(res.data);
      } catch (e) {
        console.log(e);
      }
    };
    getData();
  }, []);

  return <div className="App"></div>;
}

export default App;
